import React from 'react';
// import PropTypes from "prop-types";
// import StyledLogo from "./style.js";
import logo from './citrus-logo.png';

const styles = {
  card: {
    maxWidth: 345
  },
  media: {
    // ⚠️ object-fit is not supported by IE 11.
    objectFit: "cover"
  },
  button: {
    color: "#0097a7"
  }
};

function Logo(props) {
    const { classes } = props;
    return <img src={logo} alt='citrus' />;
}

//  Logo.propTypes = {
//   text: PropTypes.string
//  };

export default Logo;
